}

const Login = () => {
    return (
      <div className="LoginContainer">
        <h1>Login</h1>
        <div className="">
          <input autoComplete="field" placeholder="Username" id="username" className="input-field" type="text"/>
        </div>
        <div className="field">
          <input autoComplete="new-password" placeholder="Password" id="password" className="input-field" type="password"/>
        </div>
        <div className="btn">
          <button className="buttonLogin" type="submit">Login</button>
          <button className="buttonNewAccount" type="button" onClick={ () => {changePage("/")} }>Don't have an account</button>
        </div>
      </div>
    );
  };
  
